pment engine exploring protein kinase regulation. Its products pipeline includes ATI-450, an investigational oral, novel, small molecule selective MK2 inhibitor compound, which is being developed as a treatment for moderate to severe rheumatoid arthritis and additional immuno-inflammatory diseases; ATI-1777, an investigational topical soft JAK 1/3 inhibitor compound, which is being developed as a treatment for moderate to severe atopic dermatitis; and ATI-2138, an investigational oral ITK/TXK/JAK3 inhibitor compound, which is being developed as a treatment for psoriasis and/or inflammatory bowel disease. It also provides contract research services. The company was incorporated in 2012 and is headquartered in Wayne, Pennsylvania.','https://logo.clearbit.com/aclaristx.com'),('ACRX','AcelRx Pharmaceuticals Inc. Common Stock','USD','United States','2021-12-10 06:30:53',0.5802,'AcelRx Pharmaceuticals, Inc., a specialty pharmaceutical company, focuses on the development and commercialization of therapies for the treatment of acute pain. The company\'s lead product candidate is DSUVIA, a 30 mcg sufentanil sublingual tablet for the treatment of moderate-to-severe acute pain. It also develops ZALVISO, a pre-programmed and patient-controlled analgesia system that allows hospital patients with moderate-to-severe acute pain to self-dose with sufentanil sublingual tablets to manage their pain. The company was formerly known as SuRx, Inc. and changed its name to AcelRx Pharmaceuticals, Inc. in August 2006. AcelRx Pharmaceuticals, Inc. was founded in 2005 and is headquartered in Redwood City, California.','https://logo.clearbit.com/acelrx.com'),('ACST','Acasti Pharma Inc. Class A Common Stock','USD','Canada','2021-12-10 06:30:53',1.2,'Acasti Pharma Inc., a biopharmaceutical company, engages in the development and commercialization of pharmaceutical products for cardiovascular diseases. It is evaluating strategic partnerships for the clinical development of CaPre, an omega-3 phospholipid therapeutic to treat patients with hypertriglyceridemia. The company was incorporated in 2002 and is headquartered in Laval, Canada.','https://logo.clearbit.com/acastipharma.com'),('ACT','Enact Holdings Inc. Common Stock','USD','United States','2021-12-10 06:30:53',20.76,'Enact Holdings, Inc. operates as a private mortgage insurance company in the United States. The company is involved in writing and assuming residential mortgage guaranty insurance. It offers private mortgage insurance products primarily insuring prime-based, individually underwritten residential mortgage loans; and contract underwriting services for mortgage lenders. The company was formerly known as Genworth Mortgage Holdings, Inc. and changed its name to Enact Holdings, Inc. in May 2021. Enact Holdings, Inc. was founded in 1981 and is headquartered in Raleigh, North Carolina. Enact Holdings, Inc. is a subsidiary of Genworth Holdings, Inc.','https://logo.clearbit.com/new.mortgageinsurance.genworth.com'),('ACTD','ArcLight Clean Transition Corp. II Class A Ordinary Share','USD','United States','2021-12-10 06:30:53',10.07,'ArcLight Clean Transition Corp. II intends to effect a merger, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses or entities. The company was incorporated in 2021 and is based in Boston, Massachusetts.','https://logo.clearbit.com/arclightclean.com'),('ACTDU','ArcLight Clean Transition Corp. II Unit','USD','United States','2021-12-10 06:30:53',10.4,'ArcLight Clean Transition Corp. II intends to effect a merger, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses or entities. The company was incorporated in 2021 and is based in Boston, Massachusetts.','https://logo.clearbit.com/arclightclean.com'),('ACTDW','ArcLight Clean Transition Corp. II Warrant','USD','United States','2021-12-10 06:30:53',NULL,NULL,NULL),('ACTG','Acacia Research Corporation (Acacia Tech) Common Stock','USD','United States','2021-12-10 06:30:53',5.15,'Acacia Research Corporation, together with its subsidiaries, intends to acquire undervalued businesses primarily in technology, life sciences, industrial, and financial services segments in the United States. The company also invests in intellectual property and related absolute return assets, as well as engages in the licensing and enforcement of patented technologies. Acacia Research Corporation was incorporated in 1993 and is based in New York, New York.','https://logo.clearbit.com/acaciaresearch.com'),('ACVA','ACV Auctions Inc. Class A Common Stock','USD','United States','2021-12-10 06:30:53',19.84,'ACV Auctions, Inc., operates a digital marketplace that connects buyers and sellers for the online auction of wholesale vehicles. It also provides data services that offer transparent and accurate vehicle information to customers. ACV Auctions, Inc. was incorporated in 2014 and is based in Buffalo, New York.','https://logo.clearbit.com/acvauctions.com'),('ACXP','Acurx Pharmaceuticals Inc. Common Stock','USD','United States','2021-12-10 06:30:53',4.34,'Acurx Pharmaceuticals, LLC, a clinical stage biopharmaceutical company, develops antibiotics to treat bacterial infections. Its lead antibiotic candidate is ibezapolstat, a novel mechanism of action that targets the polymerase IIIC enzyme that has completed Phase II clinical trial to treat patients with clostridium difficile infections. The company is also developing ACX-375C, a potential oral and parenteral treatment targeting gram-positive bacteria, including methicillin-resistant staphylococcus aureus, vancomycin-resistant enterococcus, and penicillin-resistant streptococcus pneumoniae. The company was founded in 2017 and is based in Staten Island, New York.','https://logo.clearbit.com/acurxpharma.com'),('ADAG','Adagene Inc. American Depositary Shares','USD','China','2021-12-10 06:30:53',9.67,'Adagene Inc., a clinical stage biopharmaceutical company, engages in the research, development, and production of monoclonal antibody drugs for cancers. Its lead product candidates include ADG106, a human ligand-blocking agonistic anti-CD137 monoclonal antibodies (mAbs) that is in Phase Ib clinical trials for the treatment advanced solid tumors and non-Hodgkin\'s lymphoma; ADG126, a fully-human anti-CTLA-4 mAb for cancer treatment; and ADG116, a human ligand-blocking anti-CTLA-4 mAb, which is in Phase I clinical trial for the treatment of various tumors. The company was founded in 2011 and is headquartered in Suzhou, China.','https://logo.clearbit.com/adagene.com'),('ADALU','Anthemis Digital Acquisitions I Corp Unit','USD','United States','2021-12-10 06:30:53',10.05,'Anthemis Digital Acquisitions I Corp intends to acquire assets and businesses through a merger, capital exchange, stock purchase, reorganization, or similar business combination. It focuses on pursuing opportunities in digital financial services companies. The company was incorporated in 2021 and is based in New York, New York.',NULL),('ADAP','Adaptimmune Therapeutics plc American Depositary Shares','USD','United Kingdom','2021-12-10 06:30:53',3.69,'Adaptimmune Therapeutics plc, a clinical-stage biopharmaceutical company, focuses on providing novel cell therapies primarily to patients with solid tumors in the United States and the United Kingdom. The company\'s specific peptide enhanced affinity receptor (SPEAR) T-cell platform enables it to identify cancer targets. It is developing ADP-A2M4 that is in phase II clinical trials with SPEARHEAD-1 for synovial sarcoma and myxoid round cell liposarcoma indications (MRCLS); in phase II clinical trials with SPEARHEAD-2 for patients with head and neck cancer; and in phase I clinical trials for urothelial, melanoma, head and neck, ovarian, non-small cell lung, esophageal and gastric, synovial sarcoma, and MRCLS cancers. The company is also developing ADP-A2AFP, which is in phase I clinical trials for hepatocellular carcinoma; and ADP-A2M4CD8, which is in phase I clinical trial for SPEAR T-cells focusing on treating patients with lung, gastroesophageal, head and neck, and bladder cancers. It has a collaboration and license agreement with GSK; third party collaborations with Noile-Immune Biotech Inc., Alpine Immune Sciences, Inc., and National Center for Cancer Immune Therapy in Denmark; strategic alliance agreement with the MD Anderson Cancer Center; and co-development and co-commercialization agreement with Universal Cells, Inc. Adaptimmune Therapeutics plc also has a strategic collaboration and license agreement with Genentech, Inc. to develop and commercialize allogeneic cell therapies to treat various oncology indications. The company was founded in 2008 and is headquartered in Abingdon, the United Kingdom.','https://logo.clearbit.com/adaptimmune.com'),('ADBE','Adobe Inc. Common Stock','USD','United States','2021-12-10 06:30:53',632.57,'Adobe Inc. operates as a diversified software company worldwide. Its Digital Media segment provides tools and solutions that enable individuals, teams, and enterprises to create, publish, promote, and monetize their digital content. Its flagship product is Creative Cloud, a subscription service that allows customer to download and access the latest versions of its creative products. This segment serves content creators, experience designers, app developers, enthusiasts, students, social media users, and creative professionals; and marketing departments and agencies, companies, and publishers. The company\'s Digital Experience segment offers products, services, and solutions for creating, managing, executing, measuring, monetizing, and optimizing customer experiences from analytics to commerce. This segment serves marketers, advertisers, agencies, publishers, merchandisers, merchants, web analysts, data scientists, developers, marketing executives, information management and technology executives, product development executives, and sales and support executives. Its Publishing and Advertising segment offers products and services, such as e-learning solutions, technical document publishing, web conferencing, document and forms platform, web application development, and high-end printing, as well as publishing needs of technical and business, and original equipment manufacturers (OEMs) printing businesses. The company offers its products and services directly to enterprise customers through its sales force and local field offices, as well as to end users through app stores and through its website at adobe.com. It also distributes products and services through a network of distributors, value-added resellers, systems integrators, software vendors and developers, retailers, and OEMs. The company was formerly known as Adobe Systems Incorporated and changed its name to Adobe Inc. in October 2018. The company was founded in 1982 and is headquartered in San Jose, California.','https://logo.clearbit.com/adobe.com'),('ADER','26 Capital Acquisition Corp. Class A Common Stock','USD','United States','2021-12-10 06:30:53',9.89,'26 Capital Acquisition Corp. is a blank check company that focuses on effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization, and similar business combination with one or more businesses. The company was founded in 2020 and is based in Miami, Florida.','https://logo.clearbit.com/spac26.com'),('ADERU','26 Capital Acquisition Corp. Unit','USD','United States','2021-12-10 06:30:53',10.32,'26 Capital Acquisition Corp. is a blank check company that focuses on effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization, and similar business combination with one or more businesses. The company was founded in 2020 and is based in Miami, Florida.','https://logo.clearbit.com/spac26.com'),('ADERW','26 Capital Acquisition Corp. Warrant','USD','United States','2021-12-10 06:30:53',NULL,NULL,NULL),('ADES','Advanced Emissions Solutions Inc. Common Stock','USD','United States','2021-12-10 06:30:53',6.82,'Advanced Emissions Solutions, Inc., together with its subsidiaries, provides environmental technologies and specialty chemicals in the United States. It operates through two segments, Refined Coal and Advanced Purification Technologies. The company offers CyClean technology, a pre-combustion coal treatment process to enhance combustion, as well as to reduce emissions of nitrogen oxide and mercury from coals burned in cyclone boilers; and M-45 and M-45-PC technologies, which are pre-combustion coal treatment technologies used to control emissions from circulating fluidized bed boilers and pulverized coal boilers. It also provides mercury and other air contaminants controls; and activated carbon products, such as powdered activated carbon and granular activated carbon, as well as owns an associated lignite mine that supplies the raw material for the powdered activated carbon plant. The company\'s products are used in removal of heavy metal pollutants; treatment of drinking and waste waters; industrial acid gas and odor removal; automotive gasoline emission control; soil and ground water remediation; and food and beverage process and product purifications. It serves customers in the coal-fired power generation and industrial boiler processes. The company was founded in 1996 and is headquartered in Greenwood Village, Colorado.','https://logo.clearbit.com/advancedemissionssolutions.com');
